import {createReducer, on} from '@ngrx/store';
import {Application, IRI} from '@janeirodigital/sai-api-messages';
import * as Actions from "../actions/application.actions";
import {createEntityAdapter, EntityState} from "@ngrx/entity";

export const APPLICATION_PROFILE_STATE_KEY = 'applications';
export interface ApplicationsState extends EntityState<Application>{
  selectedApplication: IRI | null;
}

const adapter = createEntityAdapter<Application>();

export const initialState: ApplicationsState =  adapter.getInitialState({
  selectedApplication: null,
});

export const applicationProfileReducer = createReducer(
  initialState,
  on(Actions.applicationProfileReceived, (state, {profile}) => adapter.addOne(profile, state)),
  on(Actions.applicationProfilesReceived, (state, {profiles}) => adapter.addMany(profiles, state)),
  on(Actions.unregisteredApplicationProfileReceived, (state, {profile}) => adapter.addOne(profile as Application, state)),
);

export const applicationAdapter = adapter;

import {createReducer, on} from "@ngrx/store";
import * as CoreActions from "../actions/core.actions";

export const CORE_STATE_KEY = 'core';
export const CORE_LANGUAGE_KEY = 'coreLanguage';

export const preferLanguage = JSON.parse(localStorage.getItem(CORE_LANGUAGE_KEY) || '{}');

export interface CoreState {
  oidcIssuer: string;
  webId: string;
  loginKnown: boolean;
  isLoggedIn: boolean;
  isServerLoggedIn: boolean;
  redirectUrl: string;
  requestedPath: string;
  language: string;
}

export const initialState: CoreState = {
  oidcIssuer: '',
  webId: '',
  loginKnown: false,
  isLoggedIn: false,
  isServerLoggedIn: false,
  redirectUrl: '',
  requestedPath: '/dashboard',
  language: preferLanguage.language === '' || preferLanguage.language === undefined ? navigator.language.split('-')[0] : preferLanguage.language,
}

const excludedPaths = ['/', '/start', '/redirect', '/login', '/connect']

export const coreReducer = createReducer(
  initialState,
  on(CoreActions.loginInitiated, (state, {oidcIssuer}): CoreState => ({...state, oidcIssuer})),
  on(CoreActions.webIdReceived, (state, {webId}): CoreState => ({...state, webId})),
  on(CoreActions.loginStatusChanged, (state, {loggedIn}): CoreState => ({...state, isLoggedIn: loggedIn, loginKnown: true})),
  on(CoreActions.serverSessionReceived, (state, {isServerLoggedIn, redirectUrl}): CoreState => ({...state, isServerLoggedIn, redirectUrl: redirectUrl ? redirectUrl : ''})),
  on(CoreActions.pathRequested, (state, {requestedPath}): CoreState => ({
    ...state,
    requestedPath: excludedPaths.includes(requestedPath) ? '/dashboard' : requestedPath
  }))
)

import {NormalizedState} from "./index";
import {createReducer, on} from "@ngrx/store";
